import axios from "axios"
import './App.css';


function App() {
  const [coins, setCoins] = useState([]);
  useEffect(() => {
    axios.get('https://api.coingecko.com/api/v3/coins/list?include_platform=false')
    .then(res => {
      setCoins(res.data);

    }).catch(error => console.log(error))
  },[]);

  return (
    <div className="coin-app">
      <div className="coin-serch">
      <h1 className="coin-text"></h1>
      <form>
        <input typr="text" placeholder="Search" className="coin-input" />
      </form>
      </div>
    </div>
  );
}

export default App;
